import React from 'react';
import ''




class BadgeList extends React.Component {
    render() {
        return (
            <div className="BadgesList">
                <ul className="list-unstyled">
                    {this.props.badges.map(badge => {
                        return (
                            <li key={badge.id}>
                                <p>{badge.firstName} {badge.lastName}</p>
                            </li>
                        );
                    })}
                </ul>
            </div>
        );
    }
}


export default BadgeList;
